import {
  LineChart,
  XAxis,
  YAxis,
  CartesianGrid,
  Line,
  Tooltip,
  Legend,
} from "recharts";

const VariablesGraph = (props) => {
  const data = props.variables.hourly.time.map((x, index) => ({
    x,
    y: props.variables.hourly.windspeed_80m[index],
  }));
  console.log(props.variables.hourly);
  return (
    <div style={{ display: "flex", justifyContent: "center", marginTop: "10px" }}>
      <LineChart width={808} height={600} data={data}>
        <XAxis dataKey="x" />
        <YAxis dataKey="y" />
        <CartesianGrid stroke="#ccc" />
        <Line type="monotone" dataKey="y" stroke="#8884d8" />
        <Tooltip />
        <Legend />
      </LineChart>
    </div>
  );
};

export default VariablesGraph;
